import React, { useContext } from "react";
import { countContext } from "../utils/Context";

function Button(){
    const { setCount } = useContext(countContext);

    return(
        <button 
            onClick= {() => {
                setCount((count) => count + 1);
            }}
        >
            Incremenentar
        </button>
    )
}

export default Button;
